         detail:"Kathak is characterized by intricate footwork and precise rhythmic patterns that the dancer articulates by controlling about 100 ankle bells. It takes its movements from life, stylizes them, and adds the complex rhythmic patterns. Kathak is danced by both males and females; many of the dances convey moods of love.Kathak (Hindi: कथक; Urdu: کتھک) is one of the eight major forms of Indian classical dance.[1] It is the classical dance form from Uttar Pradesh. The origin of Kathak is traditionally attributed to the traveling bards in ancient northern India known as Kathakars or storytellers.[2] The term Kathak is derived from the Vedic Sanskrit word Katha which means and Kathakar which means.[2][3] Wandering Kathakars communicated stories from the great epics and ancient mythology through dance, songs and music.[3] Kathak dancers tell various stories through their hand movements and extensive footwork, their body movements and flexibility but most importantly through their facial expressions. Kathak evolved during the Bhakti movement, particularly by incorporating the childhood and stories of the Hindu god Krishna, as well as independently in the courts of north Indian kingdoms.[2][4] During the period of Mughal rule, the emperors were patrons of Kathak dance and actively promoted it in their royal courts. [5] Kathak performances include Urdu Ghazals and commonly used instruments brought during the Mughal period.[6] As a result, it is the only Indian classical dance form to feature Persian elements."
